import Navbar from "./navbar"
import axios from "axios"
import { useState,useEffect } from "react"

function History(){
    useEffect(() => {
        const token = localStorage.getItem("token");
        if (!token) {
          console.log("No token found in localStorage");
          return;
        }})
}
export default History
